import Layout from '../components/MyLayout.js';


const About = () => (
  <Layout>
    <h2>Create your post</h2>
    <form>
      <input type="text" placeholder="title"/> <br/>
      <textarea placeholder="post" />
      <button>Create</button>
    </form>
    
  </Layout>
);

export default About;
